void sun(int h)
{
float x1,y1,x2,y2;
float angle;
double radius=45;
x1=h;
y1=375;
glBegin(GL_TRIANGLE_FAN);
glVertex2f(x1,y1);
for(angle=1.0f;angle<361.0f;angle+=0.2)
{
    x2=x1+sin(angle)*radius;
    y2=y1+cos(angle)*radius;
    glVertex2f(x2,y2);
}
glEnd();
glFlush();
}
