void incspeed()
{
	speed++;
	if(speed>30)
		speed=30;
}
void decspeed()
{
	speed--;
	if(speed<1)
		speed=1;
}
void keyboard(unsigned char key,int x,int y)
{
	if(key=='S'){
		engine=1;
		speed = 1;
	}
	else if(key=='s'){
		engine=0;
		speed = 0;
	}
	else if(key=='q')
		exit(0);
	else if(key=='a')
		incspeed();
	else if(key=='z')
		decspeed();
	glutPostRedisplay();
}
void sleep1()
{
	int i,j,k;
	for(i=0;i<300;i++)
		for(j=0;j<300;j++)
			for(k=0;k<200;k++);
}
