void drawText1(int x,int y,char *string)
{
    int i, len;
    glColor3f(1.0f, 1.0f, 1.0f);
    glRasterPos2f(x,y);
    for (i=0,len=strlen(string);i<len;i++)
        glutBitmapCharacter(GLUT_BITMAP_HELVETICA_12, (int)string[i]);
}
