void disp()
{
	if(day==1000)
		day=0;
	if(i<=2)
		i=1000;
	background();
	baseline();
	if(engine==1)
	{
	i-= speed+1; 
	}
	else
		i=i;
	city();
	obj(i);
	sun_effects();
	++day;
	sleep1();
	glutSwapBuffers();
	glutPostRedisplay();
}
void display()
{
	if(showmenu<150)
	{
		menu();
		sleep1();
	}
	else
		disp();
}
int main(int argc,char** argv)
{
	glutInit(&argc,argv);
	glutInitDisplayMode(GLUT_DOUBLE|GLUT_RGB);
	glutInitWindowSize(1000,500);
	glutInitWindowPosition(10,10);
	glutCreateWindow("Tesla Cyber Truck");
	myinit();
	startscreen();
	glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);
	glEnable(GL_BLEND);
	glutDisplayFunc(display);
	glutKeyboardFunc(keyboard);
	glutMainLoop();
	return 0;
}
